Christmas Eve activation at US-10562 was loads of fun.  Great contacts with wonderful Hunters the day before Christmas.  I made contacts on 3 bands using the @spooltenna 4010 EFHW.  If you watch, you see why it's always 72 degrees in the shack.'
I really want to wish all of the great POTA Hunters and Activators who make this activity so much fun.  
